import React, {Component} from 'react';
import {withStyles} from '@material-ui/core/styles';
import {TextField} from '@material-ui/core'

const InputField = withStyles({
    root: {
        '& label.Mui-focused': {
            color: 'tomato',
        },
        '& label': {
            color: 'tan'
        },
        '& .MuiOutlinedInput-root': {
            '& fieldset': {
                borderColor: 'tan'
            },
            '&:hover fieldset': {
                borderColor: 'tan'
            },
            '& .Mui-focused fieldset': {
                borderColor: 'tan'
            }
        },
    },
})(TextField);
class ListBuilder extends Component {
    state= {
        people: [
            {
                id: 1,
                name: 'Alton',
                attendence: true
            }
        ]
    }
    render() {
        const {people} = this.state
        return (
            <div>
                <h1>Names list</h1>
                <ul>
                    {people.map((person)=> {
                        return <li key={person.id}>Person's name is {person.name}</li>
                    })}
                </ul>
                <InputField 
                    label='Name' 
                    fullWidth={true} 
                    variant='outlined' 
                    size='medium' 
                    />   
            </div>
        )
    }
}

export default ListBuilder;
